import React  from "react";
import TableRow from './TableRow'

function Home( {list} ) {

  function sort( object ){
    list.sort( (a,b) => {return a[object] > b[object] ? 1 : -1; })
    console.log('sort test', list)
  }

  return (
    <div className="container">
        <table className="table table-hover">
            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col" onClick="sort(" >Name</th>
                    <th scope="col" onClick="" >Location</th>
                </tr>
            </thead>
            <tbody>
                {Object.entries(list).map( ([key,value]) => <TableRow key={key} list={[Number(key)+1,value]} /> )}
            </tbody>
        </table>
    </div>
  );
}

export default Home;
